import React from 'react'
import { Route, Link, Switch } from 'react-router-dom'

class Signup extends React.Component{
  render(){
    return(
      <div>
      <h1>Registration Form </h1>

        <Link to='/'><button>GO BACK</button></Link>
      </div>
    )
  }
}

export default Signup
